import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      gridArray:[ [ "false", "true"], [ "true", "true" ] ],
    }
  }

  render(){
    return (
      <div className="App">
        <header className="App-header">
        </header>

        <body>

          <div className="GridDiv">
            { this.state.gridArray.map(Element => Element.map(Element2 => <h1>{Element2}</h1> )) }
          </div>
          {console.table(this.state.gridArray)}
        </body>
      </div>
    );
  }

}

export default App;
